import React, { useState } from 'react';

export default class Results extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    console.log(this.props.results);
    return (
      <div>{
        Object.keys(this.props.results).forEach(function (item) {
          <React.Fragment>
          <p>item</p>
          <p>this.props.results[item]</p>
          </React.Fragment>
          })
        }
    </div>
    );
  }
}
